import React from "react";
import "./style.scss";

function PublishedCourseListItem(props) {
  return (
    <div className="adminclassroom-publishedcourse-item">
      <div className="adminclassroom-publishedcourse-item-section1"></div>
      <div className="adminclassroom-publishedcourse-item-section2"></div>
    </div>
  );
}

export default PublishedCourseListItem;
